import React, { useState } from "react";
import { Button, Container } from "react-bootstrap";

export const API = () => {
  const [api, setApi] = useState([]);

  const fetchData = () => {
    fetch("https://api.restful-api.dev/objects")
      .then((res) => res.json())
      .then((data) => {
        setApi(data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  };


  return (
    <>
    <div>
